var Particle = function (x, y, size, xSpeed, ySpeed) {
    this.x = x;
    this.y = y;
    this.size = typeof size === 'undefined' ? Math.floor(Math.random() * 10) : size;
    this.xSpeed = typeof xSpeed === 'undefined' ? Math.floor(Math.random() * 10) - 5 : xSpeed;
    this.ySpeed = typeof ySpeed === 'undefined' ? Math.floor(Math.random() * 10) - 5 : ySpeed;
    this.maxLifetime = 100;
    this.lifetime = this.maxLifetime;
    this.rgb = [255, 255, 255];
};

var ParticleBanner = function () {
    this.context = null;
    this.canvas = null;
    this.started = false;
    this.particles = [];
    this.interval = null;
    this.colourModeInterval = null;
    this.drawModeInterval = null;
    this.colourMode = 0;
    this.drawMode = 0;
    this.degrees = 0;
    this.catFace = document.createElement('img');
    this.catFace.src = 'data:image/png;base64,';
};

ParticleBanner.prototype.init = function () {

    var w = window,
        d = document,
        e = d.documentElement,
        g = d.getElementsByTagName('body')[0],
        width = w.innerWidth || e.clientWidth || g.clientWidth || 0,
        height = w.innerHeight || e.clientHeight || g.clientHeight || 0;

    if (!width || !height) {
        return false;
    }

    g.style.padding = g.style.margin = '0';
    g.style.overflow = 'hidden';
    g.style.backgroundColor = 'black';

    var old = document.getElementById('particles');
    if (old !== null) old.parentNode.removeChild(old);

    this.canvas = document.createElement("canvas");
    this.canvas.setAttribute('id', 'particles');
    this.context = this.canvas.getContext("2d");
    this.context.globalCompositeOperation = 'lighter';
    this.canvas.width = width;
    this.canvas.height = height;
    this.canvas.style.position = "fixed";
    this.canvas.style.top = "0px";
    this.canvas.style.opacity = "0.8";
    this.canvas.style.pointerEvents = "none";
    document.body.appendChild(this.canvas);
    return true;
};

ParticleBanner.prototype.clear = function () {
    this.context.clearRect(0, 0, this.canvas.width * 2, this.canvas.height * 2);
};

ParticleBanner.prototype.start = function () {
    this.started = true;
    clearInterval(this.interval);
    clearInterval(this.colourModeInterval);
    clearInterval(this.drawModeInterval);
    this.colourModeInterval = setInterval(function () {
        this.colourMode++;
    }.bind(this), 3000);
    this.drawModeInterval = setInterval(function () {
        this.drawMode++;
    }.bind(this), 500);
    this.interval = setInterval(this.update.bind(this), 25);
    window.requestAnimationFrame(this.renderFrame.bind(this));
};

ParticleBanner.prototype.stop = function () {
    this.started = false;
    clearInterval(this.interval);
};

ParticleBanner.prototype.getColour = function () {
    this.colourMode = this.colourMode % 10;

    var r, g, b;

    switch (this.colourMode) {
        case 0: // white
            return [
                255,
                255,
                255
            ];
        case 1: // multicolour
            return [
                Math.floor(Math.random() * 255),
                Math.floor(Math.random() * 255),
                Math.floor(Math.random() * 255)
            ];
        case 2: // autumn
            return [
                Math.floor(Math.random() * 255),
                Math.floor(Math.random() * 255),
                0
            ];
        case 3: // neon
            r = Math.floor(Math.random() * 255);
            b = Math.floor(Math.random() * 255);
            g = Math.floor(Math.random() * ((r + b) / 2));
            return [r, g, b];
        case 4: // burning
            return [
                Math.floor(Math.random() * 128) + 128,
                Math.floor(Math.random() * 64) + 64,
                Math.floor(Math.random() * 32) + 32
            ];
        default:
            return [
                Math.floor(Math.random() * 255),
                Math.floor(Math.random() * 255),
                0 //Math.floor(Math.random() * 255)
            ];
    }
};

ParticleBanner.prototype.update = function () {

    var i, particleAddCount = 4;

    for (i = 0; i < particleAddCount; i++) {
        this.particles.push(this.createParticle());
    }

    for (i = this.particles.length - 1; i >= 0; i--) {
        if (--this.particles[i].lifetime === 0) {
            this.particles.splice(i, 1);
            continue;
        }
        this.particles[i].size *= 0.99;
        this.particles[i].x = this.particles[i].x + this.particles[i].xSpeed;
        this.particles[i].y = this.particles[i].y + this.particles[i].ySpeed;
    }

    this.degrees += 0.5;
    this.degrees = this.degrees % 360;
};

ParticleBanner.prototype.createParticle = function () {
    var particle;

    switch (Math.floor(Math.random() * 4)) {

        case 3:
            particle = new Particle(Math.floor(this.canvas.width / 4), Math.floor(this.canvas.height / 2), Math.floor(Math.random() * Math.floor(Math.max(this.canvas.width, this.canvas.height) / 15)));
            particle.rgb = this.getColour();
            particle.drawMode = this.drawMode % 10;
            break;
        case 2:
            particle = new Particle(Math.floor(this.canvas.width / 2), Math.floor(this.canvas.height / 4), Math.floor(Math.random() * Math.floor(Math.max(this.canvas.width, this.canvas.height) / 15)));
            particle.rgb = this.getColour();
            particle.drawMode = this.drawMode % 10;
            break;
        case 1:
            particle = new Particle(Math.floor(this.canvas.width / 4), Math.floor(this.canvas.height / 4), Math.floor(Math.random() * Math.floor(Math.max(this.canvas.width, this.canvas.height) / 15)));
            particle.rgb = this.getColour();
            particle.drawMode = this.drawMode % 10;
            break;
        default:
            particle = new Particle(Math.floor(this.canvas.width / 2), Math.floor(this.canvas.height / 2), Math.floor(Math.random() * Math.floor(Math.max(this.canvas.width, this.canvas.height) / 15)));
            particle.rgb = this.getColour();
            particle.drawMode = this.drawMode % 10;
            break;
    }
    return particle;
}

ParticleBanner.prototype.drawShape = function (x, y, size, drawMode) {

    switch (drawMode) {
        case 2:
            this.context.globalCompositeOperation = 'overlay';
            this.context.drawImage(this.catFace, x - (size), y - (size), size * 2, size * 2);
            break;
        default:
            this.context.globalCompositeOperation = 'lighter';
            this.context.arc(x, y, size, 0, Math.PI * 2, true);
            break;
    }

};

ParticleBanner.prototype.renderFrame = function () {

    this.clear();

    this.context.save();

    this.context.translate(this.canvas.width / 2, this.canvas.height / 2);
    this.context.rotate(this.degrees * Math.PI / 180);
    this.context.translate(-this.canvas.width / 2, -this.canvas.height / 2);

    for (var i = 0; i < this.particles.length; i++) {
        this.context.beginPath();
        this.context.fillStyle = "rgba(" + this.particles[i].rgb.join(',') + ',' + ((this.particles[i].lifetime / this.particles[i].maxLifetime)) + ')';
        this.drawShape(this.particles[i].x, this.particles[i].y, this.particles[i].size, this.particles[i].drawMode);
        this.context.closePath();
        this.context.fill();
    }

    this.context.restore();

    if (this.started) {
        window.requestAnimationFrame(this.renderFrame.bind(this));
    }

};

var pb = new ParticleBanner();

document.addEventListener("DOMContentLoaded", function (event) {
    pb.init();
    pb.start();
});

window.addEventListener('resize', function () {
    pb.stop();
    pb.init();
    pb.start();
});

